import './App.css';
import principalImg from './assets/cellphone.png';
import voxsweetLogo from './assets/Logo.png';
import { Signup } from './components/Signup'


function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6 principal-img">
          <img className="principal-img" src={principalImg} alt=""/>
        </div>

        <div className="col-6 principal-content">
          <img className="" src={voxsweetLogo} alt=""/>
          <div className="principal-content-form">
            <Signup />
          </div>

        </div>

      </div>
    </div>
  );
}

export default App;
